import axios from "axios";
import { useEffect, useState } from "react";

import { Divider } from "@mui/material";
import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Typography from "@mui/material/Typography";
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";

import MUIDataTable from "mui-datatables";

const columns = ["Name", "Entry ID", "Created At", "Updated At"];

const options = {
  responsive: "simple",
  rowsPerPage: 20,
  viewColumns: true,
  pagination: true,
  selectableRows: "none",
  rowsPerPageOptions: [20, 50, 100],
  textLabels: {
    body: {
      noMatch: "Sorry, no matching records found",
      toolTip: "Sort",
      columnHeaderTooltip: (column) => `Sort for ${column.label}`,
    },
    pagination: {
      next: "Next Page",
      previous: "Previous Page",
      rowsPerPage: "Rows per page:",
      displayRows: "of",
    },
    toolbar: {
      search: "Search",
      downloadCsv: "Download CSV",
      print: "Print",
      viewColumns: "View Columns",
      filterTable: "Filter Table",
    },
    filter: {
      all: "All",
      title: "FILTERS",
      reset: "RESET",
    },
    viewColumns: {
      title: "Show Columns",
      titleAria: "Show/Hide Table Columns",
    },
    selectedRows: {
      text: "row(s) selected",
      delete: "Delete",
      deleteAria: "Delete Selected Rows",
    },
  },

  onRowClick: (rowData, rowMeta) => {
    console.log(rowData);
    console.log(rowMeta);
  },
};

function ListAllEntries() {
  const [fuckingData, setData] = useState([]);
  useEffect(async () => {
    axios.get("http://localhost:9001/entries/all").then((res) => {
      const threads = res.data;
      setData(threads);

      console.log(threads.data);
    });
  });

  return (
    <DashboardLayout>
      <Box mt={2} mb={1}>
        <Grid container spacing={1} justifyContent="center">
          <Grid item xs={12} lg={8}>
            <Card>
              <Box p={2}>
                <Typography variant="h5">JSON to Table Test</Typography>
                <Divider>-</Divider>
                <MUIDataTable
                  title="Lista de Entradas"
                  data={fuckingData}
                  columns={columns}
                  options={options}
                />
              </Box>
            </Card>
          </Grid>
        </Grid>
      </Box>
    </DashboardLayout>
  );
}

export default ListAllEntries;
